import React from "react";

const ThinkTankLanding = () => {
  return (
    <div className="bg-white text-black min-h-screen">
      {/* Header Section */}
      <header className="text-center py-10 bg-gold">
        <h1 className="text-5xl font-bold text-black">Think Tank Solutions</h1>
        <p className="text-lg mt-2 text-gray-800">
          Innovative strategies for transformation
        </p>
        <button className="mt-4 px-6 py-2 bg-black text-white font-bold rounded hover:bg-gray-800 transition">
          Get Started
        </button>
      </header>

      {/* About Us Section */}
      <section className="max-w-4xl mx-auto text-center py-12">
        <h2 className="text-3xl font-bold text-gold">About Us</h2>
        <p className="mt-2 text-gray-600">
          We are dedicated to providing strategic solutions that drive success and innovation.
        </p>
      </section>

      {/* Services Section */}
      <section className="max-w-4xl mx-auto py-12">
        <h2 className="text-3xl font-bold text-gold text-center">Our Services</h2>
        <div className="mt-6 grid grid-cols-1 md:grid-cols-3 gap-6">
          {["Consulting", "Business Strategy", "Market Analysis"].map((service, index) => (
            <div key={index} className="p-6 bg-black text-white rounded-lg shadow-lg text-center">
              <h3 className="text-xl font-bold text-gold">{service}</h3>
              <p className="mt-2 text-gray-300">Professional insights tailored to your needs.</p>
            </div>
          ))}
        </div>
      </section>

      {/* Contact Section */}
      <section className="text-center py-12 bg-gold">
        <h2 className="text-3xl font-bold text-black">Get in Touch</h2>
        <p className="mt-2 text-gray-800">Connect with us for transformative solutions.</p>
        <button className="mt-4 px-6 py-2 bg-black text-white font-bold rounded hover:bg-gray-800 transition">
          Contact Us
        </button>
      </section>
    </div>
  );
};

export default ThinkTankLanding;
